;; **
;;; # Non-Photorealistic Rendering
;; **

;; **
;;; This is following the instructions from the post [non-photorealistic-rendering-using-opencv-python-c](https://www.learnopencv.com/non-photorealistic-rendering-using-opencv-python-c/) but using origami.
;;; 
;;; It is a partial implementation of a SIGGRAPH 2011 paper titled “Domain transform for edge-aware image and video processing” by Eduardo Gastal and Manuel Oliveira.
;;; 
;;; In origami, the paper's bilateral filter functions can be used via the four functions below:
;;; 
;;; - edge-preserving-filter
;;; - detail-enhance
;;; - pencil-sketch
;;; - stylization
;; **

;; @@
(ns whispering-willow
  (:require
    [opencv4.core :refer :all]
    [opencv4.utils :as u]))
;; @@
;; =>
